import React from "react";
import { Link } from "react-router-dom";
import { FaCoffee } from "react-icons/fa";
const Navbar = () => {
  return (
    <div className="p-0 m-0  navbar d-flex  justify-content-between align-items-center">
      <div className="p-2 m-0 col-md-4 col-sm-6 col-6 d-flex  justify-content-center align-items-center">
        <i
          className="p-0 m-0 navbar-icon"
          style={{
            backgroundImage: "url(/images/navbarowl.png)",
          }}
        >
          <img src="/images/navbarowl.png" alt="bonte" />
        </i>
        <h3 className="p-2 m-0  d-flex justify-content-center align-items-center">
          Bonte Takeaway
        </h3>
      </div>
      <div className="col-md-4 d-none d-md-flex"></div>

      <ul className="p-1 m-0 bg-danger col-md-4 col-sm-6 d-none d-sm-flex justify-content-center align-items-center">
        <Link className="link text-decoration-none" to="/">
          <li className="p-0 m-3">Home</li>
        </Link>
        <Link className="link text-decoration-none" to="/menu">
          <li className="p-0 m-3">Menu</li>
        </Link>
        <li className="p-0 m-3">About </li>
        <li className="p-0 m-3">Contact us</li>
      </ul>
      <div className="d-flex d-sm-none justiy-content-center align-items-center">
        <i>
          <FaCoffee />
        </i>
      </div>
    </div>
  );
};

export default Navbar;
